import React from 'react'


function Todolis() {
    return(

        <div className="main-div">
      <div className="child-div">
        <h1 >Todo-list</h1>
        <input className="form-control" type="text" />
       
        <button className="btn btn-primary">Submit</button>
        </div>
        </div>
        
      )
}

export default Todolis
